import React from 'react';
import '../../sass/main.css'
import Tela1 from '../tela1/Tela1';
import Tela2 from '../tela2/Tela2';
import Tela3 from '../tela3/Tela3';
import Tela4 from '../tela4/Tela4';
import Tela5 from '../tela5/Tela5';
import Tela6 from '../tela6/Tela6';
import Tela7 from '../tela7/Tela7';
import Tela8 from '../tela8/Tela8';
import Tela9 from '../tela9/Tela9';
import Tela10 from '../tela10/Tela10';
import { ExpandLess, ExpandMore } from '@mui/icons-material';
import { Collapse, List, ListItemButton, ListItemText } from '@mui/material';
import { ListSubheader } from '@material-ui/core';
import AIProp from '../tela1/AlteraInfoProp';
import AIVeic from '../tela1/AlteraInfoVeic';
import ARFin from '../tela1/AlteraRestFinanc';
import AACara from '../tela2/AutorizaAlteraCaracteristica.jsx';
import AFPlaca from '../tela2/AutorizaFabPlaca';
import ARChassi from '../tela2/AutorizaRegChassi';
import ARMotor from '../tela2/AutorizaRegMotor';
import ACLPlaca from '../tela2/AutorizaColocaLacrePlaca';
import BPEFab from '../tela3/BaixaPlacaExFab';
import BMilitar from '../tela3/BaixaMilitar';
import BUF from '../tela3/BaixaUF';
import BPais from '../tela3/BaixaPais';
import BSVeiculo from '../tela3/BaixaSimplesVeic';
import ComProcess from '../tela4/ComunicacaoProcesso';
import CamProcess from '../tela4/CancelamentoProcess';
import CChassi from '../tela5/CorrecaoChassi';
import CIProp from '../tela5/CorrecaoInfoProp';
import CIVeic from '../tela5/CorrecaoInfoVeic';
import CMuni from '../tela5/CorrecaoMuni';
import CObs from '../tela5/CorrecaoObservacaoCRLV';
import CRest from '../tela5/CorrecaoRest';
import IAExec from '../tela6/IncluAverbExec';
import IPEFab from '../tela6/IncluPlacaExFab';
import IRFinan from '../tela6/IncluRestFinan';
import TPVRS from '../tela7/TransfPropVeicRS';
import TPVUF from '../tela7/TransfPropVeicUF';
import TMVRS from '../tela7/TrocaMunVeicRS';
import TMVUF from '../tela7/TrocaMunVeicUF';
import ECert from '../tela8/EmissaoCertidao';
import ICrlv from '../tela8/ImpressCRLV';
import LRFinan from '../tela8/LibRestFinan';
import LETran from '../tela8/LicEspecTran';
import MPUMerc from '../tela8/MudPlacUniMerc';
import PEmp from '../tela8/PrimEmplac';
import RPEFab from '../tela8/RenPlacaExpFab';
import RPlac from '../tela8/ResPlaca';
import RTran from '../tela8/ResTran';
import SVist from '../tela8/SolVist';
// import Tela11 from '../tela11/Tela11';
// import Tela12 from '../tela12/Tela12';

const Inicial = () => {

    const [tela1, setTela1] = React.useState(false);
    const [tela2, setTela2] = React.useState(false);
    const [tela3, setTela3] = React.useState(false);

    const botaoOpt1 = () => {
        tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
    }
    const botaoOpt2 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
    }
    const botaoOpt3 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        tela3 ? setTela3(tela3) : setTela3(!tela3);
    }
    const [open1, setOpen1] = React.useState(true);
    const [open2, setOpen2] = React.useState(true);
    const [open3, setOpen3] = React.useState(true);
    const [open4, setOpen4] = React.useState(true);
    const [open5, setOpen5] = React.useState(true);
    const [open6, setOpen6] = React.useState(true);
    const [open7, setOpen7] = React.useState(true);
    const [open8, setOpen8] = React.useState(true);

    const handleClick1 = () => {
        setOpen1(!open1);
    };
    const handleClick2 = () => {
        setOpen2(!open2);
    };
    const handleClick3 = () => {
        setOpen3(!open3);
    };
    const handleClick4 = () => {
        setOpen4(!open4);
    };
    const handleClick5 = () => {
        setOpen5(!open5);
    };
    const handleClick6 = () => {
        setOpen6(!open6);
    };
    const handleClick7 = () => {
        setOpen7(!open7);
    };
    const handleClick8 = () => {
        setOpen8(!open8);
    };

    const SelecionaConsultas = () => {
        return (
            <>
                <ListItemButton 
                    sx={{ 
                            color:'black',
                            height: 45,
                            fontSize: 16,
                            bgcolor: 'orange',
                            "&:hover": {
                                    bgcolor:"darkorange"
                                    } 
                        }}
                    onClick={handleClick1}>
                    <ListItemText
                        sx={{
                            p:0
                        }}
                    >Consultas</ListItemText>
                </ListItemButton>
            </>
        )
    }

    return (
        <>
            <nav className='menu--superior'>
                <div>
                    <p className='nav-item' >Prontas</p>
                    <p className='nav-item' >Realizadas</p>
                </div>
            </nav>
            <aside className='menu--lateral'>
                <div>
                    <List
                        sx={{ width: '100%', maxWidth: 360, paddingBottom:1/8 }}
                    >
                        <SelecionaConsultas />
                        <Collapse in={!open1} timeout="auto" unmountOnExit>
                            <p className='item' onClick={botaoOpt1} >Alteração de Informações do Proprietário</p>
                            <p className='item' onClick={botaoOpt2} >Alteração de Informações do Veículo</p>
                            <p className='item' onClick={botaoOpt3} >Alteração de Restrição Financeira</p>
                        </Collapse>
                        {/* <Collapse in={!open2} timeout="auto" unmountOnExit>
                            <AACara />
                            <AFPlaca />
                            <ARChassi />
                            <ARMotor />
                            <ACLPlaca />
                        </Collapse>
                        <Collapse in={!open3} timeout="auto" unmountOnExit>
                            <BPEFab />
                            <BMilitar />
                            <BUF />
                            <BPais />
                            <BSVeiculo />
                        </Collapse>
                        <Collapse in={!open4} timeout="auto" unmountOnExit>
                            <ComProcess />
                            <CamProcess />
                        </Collapse>
                        <Collapse in={!open5} timeout="auto" unmountOnExit>
                            <CChassi />
                            <CIProp />
                            <CIVeic />
                            <CMuni />
                            <CObs />
                            <CRest />
                        </Collapse>
                        <Collapse in={!open6} timeout="auto" unmountOnExit>
                            <IAExec />
                            <IPEFab />
                            <IRFinan />
                        </Collapse>
                        <Collapse in={!open7} timeout="auto" unmountOnExit>
                            <TPVRS />
                            <TPVUF />
                            <TMVRS />
                            <TMVUF />
                        </Collapse>
                        <Collapse in={!open8} timeout="auto" unmountOnExit>
                            <ECert />
                            <ICrlv />
                            <LRFinan />
                            <LETran />
                            <MPUMerc />
                            <PEmp />
                            <RPEFab />
                            <RPlac />
                            <RTran />
                            <SVist />
                        </Collapse> */}
                    </List>
                </div>
            </aside>
            <div className='tela--inicial'>
                <div>
                    <h1 id='CRDDRS'>CRDDRS</h1>
                    { !tela1 ? null : <AIProp /> }
                    { !tela2 ? null : <AIVeic /> }
                    { !tela3 ? null : <ARFin /> }
                            
                            
                    {/* {!tela1 ? null : <Tela1 />}
                    {!tela2 ? null : <Tela2 />}
                    {!tela3 ? null : <Tela3 />}
                    {!tela4 ? null : <Tela4 />}
                    {!tela5 ? null : <Tela5 />}
                    {!tela6 ? null : <Tela6 />}
                    {!tela7 ? null : <Tela7 />}
                    {!tela8 ? null : <Tela8 />}
                    {!tela9 ? null : <Tela9 />}
                    {!tela10 ? null : <Tela10 />} */}
                    {/* {!tela11 ? null : <Tela11 />}
                    {!tela12 ? null : <Tela12 />} */}
                </div>
            </div>
        </>
    )
}

export default Inicial
